import React, { useState } from 'react'
import Navbar from './NavBar';
import Page from './Page';
import { BrowserRouter as Router } from 'react-router-dom';


function App() {
    const [theme, setTheme] = useState("dark");
    return (
        <Router className={theme}>
            <div>
                <Navbar />
                <Page theme={setTheme} />
            </div>
        </Router>
    );
}


export default App;
